import React from "react";
import { Link } from "react-router-dom/cjs/react-router-dom.min";

class List extends React.Component{

  constructor(){
    super();
    this.state={
      data:[]
    };
  }

  fetchData(){
    fetch('http://127.0.0.1:8000/employee/')
    .then(response=>response.json())
    .then((data)=>{
      this.setState({
        data:data 
      });
    });
  }

  render(){
    return(
      <div><table className="table table-striped">
      <thead>
        <tr>
          <th scope="col">Identité</th>
          <th scope="col">Nom Complet</th>
          <th scope="col">Email</th>
          <th scope="col">Contact</th>
          <th scope="col">Adresse</th>
          <th scope="col">Actions</th>
        </tr>
      </thead>
      <tbody>
        <tr>
          <th scope="row">1</th>
          <td> Nom Complet </td>
          <td> Email </td>
          <td> Contact </td>
          <td> Adresse </td>
          <td> 
              <Link to="/update/1" className="btn btn-info" > Modifier </Link> 
              <button className="btn btn-danger ml-3"> Supprimer </button>   
          </td>
        </tr>
        <tr>
          <th scope="row">2</th>
          <td>Jacob</td>
          <td>Thornton</td>
          <td>@fat</td>
          <td> Adresse </td> 
          <td> 
              <Link to="/update/1" className="btn btn-info" > Modifier </Link>    
              <button className="btn btn-danger ml-3"> Supprimer </button>
          </td>                       
        </tr>
        <tr>
          <th scope="row">3</th>
          <td>Larry</td>
          <td>the Bird</td>
          <td>@twitter</td>
          <td> Adresse </td> 
          <td> 
              <Link to="/update/1" className="btn btn-info"> Modifier </Link>    
              <button className="btn btn-danger ml-3"> Supprimer </button>
          </td>           
        </tr>
      </tbody>
      </table>

      </div>
  )
  }
}

export default List;
